column4:
Telefonas per daug įkaito, todėl buvo išj., kad atvėstų. Dabar telefonas veikia įprastai.

Telefonas gali per daug įkaisti, jei:
 • esate įjungę daug išteklių naudoj. progr. (pvz., žaidimų, vaizdo įr. arba navig. progr.);
 • atsis. arba įkeliate didelius failus;
 • telefoną naudojate aukštoje temper.

