column4:
Jei programa nenaudojama kelis mėnesius:

• pašalinami leidimai siekiant apsaugoti jūsų duomenis;
• sustabdomi pranešimai, siekiant tausoti akumuliatoriaus energiją;
• pašalinami laikinieji failai siekiant atlaisvinti vietos;

Norėdami vėl suteikti leidimus ir leisti pranešimus, atidarykite programą.
